0420\u041e\u0421\u0414\u041f<\/a>, \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u0435\u043c \u043f\u0430\u0440\u0442\u0438\u0438 \u0438\u0437\u0431\u0440\u0430\u043d \u044d\u043a\u0441-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%82_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0421\u0421\u0420\">\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u0421\u0421\u0421\u0420<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041c\u0438\u0445\u0430\u0438\u043b \u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2004_%D0%B3%D0%BE%D0%B4\" title=\"2004 \u0433\u043e\u0434\">2004<\/a>&#160;\u2014 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D0%B0%D0%BA%D1%82%D1%8B_%D0%B2_%D0%9C%D0%B0%D0%B4%D1%80%D0%B8%D0%B4%D0%B5_(2004)\" title=\"\u0422\u0435\u0440\u0430\u043a\u0442\u044b \u0432 \u041c\u0430\u0434\u0440\u0438\u0434\u0435 (2004)\">\u0442\u0435\u0440\u0430\u043a\u0442\u043e\u0432 \u0432 \u043c\u0430\u0434\u0440\u0438\u0434\u0441\u043a\u0438\u0445 \u043f\u0440\u0438\u0433\u043e\u0440\u043e\u0434\u043d\u044b\u0445 \u043f\u043e\u0435\u0437\u0434\u0430\u0445<\/a> \u043f\u043e\u0433\u0438\u0431 191 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009_%D0%B3%D0%BE%D0%B4\" title=\"2009 \u0433\u043e\u0434\">2009<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BD%D0%BD%D0%B5%D0%BD%D0%B4%D0%B5%D0%BD\" title=\"\u0412\u0438\u043d\u043d\u0435\u043d\u0434\u0435\u043d\">\u0412\u0438\u043d\u043d\u0435\u043d\u0434\u0435\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f<\/a>) \u0422\u0438\u043c \u041a\u0440\u0435\u0442\u0447\u043c\u0435\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%81%D1%81%D0%BE%D0%B2%D0%BE%D0%B5_%D1%83%D0%B1%D0%B8%D0%B9%D1%81%D1%82%D0%B2%D0%BE_%D0%B2_%D0%92%D0%B8%D0%BD%D0%BD%D0%B5%D0%BD%D0%B4%D0%B5%D0%BD%D0%B5\" title=\"\u041c\u0430\u0441\u0441\u043e\u0432\u043e\u0435 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e \u0432 \u0412\u0438\u043d\u043d\u0435\u043d\u0434\u0435\u043d\u0435\">\u0443\u0441\u0442\u0440\u043e\u0438\u043b \u0441\u0442\u0440\u0435\u043b\u044c\u0431\u0443 \u0432 \u0441\u0432\u043e\u0435\u0439 \u0431\u044b\u0432\u0448\u0435\u0439 \u0448\u043a\u043e\u043b\u0435, \u0430 \u0437\u0430\u0442\u0435\u043c \u0438 \u0432 \u043e\u043a\u0440\u0443\u0433\u0435<\/a>. \u0423\u0431\u0438\u0432 15 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0438 \u0440\u0430\u043d\u0438\u0432 11, \u043e\u043d \u043f\u043e\u043a\u043e\u043d\u0447\u0438\u043b \u0441 \u0441\u043e\u0431\u043e\u0439 \u0432 \u043e\u043a\u0440\u0443\u0436\u0435\u043d\u0438\u0438 \u043f\u043e\u043b\u0438\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2011_%D0%B3%D0%BE%D0%B4\" title=\"2011 \u0433\u043e\u0434\">2011<\/a><ul><li>\u0443 \u0441\u0435\u0432\u0435\u0440\u043e-\u0432\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0433\u043e \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D1%8F\" title=\"\u042f\u043f\u043e\u043d\u0438\u044f\">\u042f\u043f\u043e\u043d\u0438\u0438<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B2_%D0%AF%D0%BF%D0%BE%D0%BD%D0%B8%D0%B8_(2011)\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435 \u0432 \u042f\u043f\u043e\u043d\u0438\u0438 (2011)\">\u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435<\/a> \u043c\u0430\u0433\u043d\u0438\u0442\u0443\u0434\u043e\u0439 \u043e\u043a\u043e\u043b\u043e 9.0, \u043f\u043e\u0432\u043b\u0435\u043a\u0448\u0435\u0435 \u0437\u0430 \u0441\u043e\u0431\u043e\u0439 \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%83%D0%BD%D0%B0%D0%BC%D0%B8\" title=\"\u0426\u0443\u043d\u0430\u043c\u0438\">\u0446\u0443\u043d\u0430\u043c\u0438<\/a>.<\/li><li>\u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B1%D0%B5%D1%80%D0%B1%D0%B0%D0%BD%D0%BA_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8\" title=\"\u0421\u0431\u0435\u0440\u0431\u0430\u043d\u043a \u0420\u043e\u0441\u0441\u0438\u0438\">\u0421\u0431\u0435\u0440\u0431\u0430\u043d\u043a\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B5%D1%84,_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD_%D0%9E%D1%81%D0%BA%D0%B0%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u0440\u0435\u0444, \u0413\u0435\u0440\u043c\u0430\u043d \u041e\u0441\u043a\u0430\u0440\u043e\u0432\u0438\u0447\">\u0413\u0435\u0440\u043c\u0430\u043d \u0413\u0440\u0435\u0444<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%80%D0%B4%D0%B0%D0%BD%D1%8F%D0%BD,_%D0%A0%D1%83%D0%B1%D0%B5%D0%BD_%D0%9A%D0%B0%D1%80%D0%BB%D0%B5%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0412\u0430\u0440\u0434\u0430\u043d\u044f\u043d, \u0420\u0443\u0431\u0435\u043d \u041a\u0430\u0440\u043b\u0435\u043d\u043e\u0432\u0438\u0447\">\u0420\u0443\u0431\u0435\u043d \u0412\u0430\u0440\u0434\u0430\u043d\u044f\u043d<\/a> \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0421\u0431\u0435\u0440\u0431\u0430\u043d\u043a \u043f\u043e\u043a\u0443\u043f\u0430\u0435\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D0%B9%D0%BA%D0%B0_%D0%94%D0%B8%D0%B0%D0%BB%D0%BE%D0%B3\" title=\"\u0422\u0440\u043e\u0439\u043a\u0430 \u0414\u0438\u0430\u043b\u043e\u0433\">\u0422\u0440\u043e\u0439\u043a\u0443 \u0414\u0438\u0430\u043b\u043e\u0433<\/a>\u00bb \u0437\u0430 $1&#160;\u043c\u043b\u0440\u0434.<\/li><\/ul><\/li><\/ul><h2>"}